import React from 'react';

function LearningItem({title,imageUrl}) {
    return (
        <div>
            <h1>
                {title}
            </h1>
            <div>
                <img src={imageUrl} alt="image"/>
            </div>
            <div>
                    test
            </div>
        </div>
    );
}

export default LearningItem;
